CREATE DEFINER=`root`@`localhost` PROCEDURE `new_procedure`(_num tinyint(4), stdataID mediumint(9), _rsp decimal(2, 1))
BEGIN

		
		SET @distID = (SELECT id FROM distributions WHERE areas_id = getAreaIDByStudentID(stdataID) AND (_num BETWEEN dfrom AND dto));

		SET @respID = (CASE
			WHEN _rsp = 0 THEN 3
			WHEN _rsp < 0 THEN 2
			WHEN _rsp > 0 THEN 1
			ELSE 3
		END);
		
		SET @countQst = (SELECT count(1) FROM questions WHERE number = _num AND student_data_id = stdataID AND responses_id = @respID AND distributions_id = @distID);
		
		IF (@countQst = 0) THEN
			SELECT concat_ws(' -- ', 'No esta:',_num, stdataID, _rsp, @respID, @distID) as rsta;
		ELSE
			SELECT concat_ws(' ** ', 'Ya esta:',_num, stdataID, _rsp, @respID, @distID) as rsta;
		END IF;
END ;;
