CREATE DEFINER=`root`@`localhost` PROCEDURE `spCountCoursesMissing`()
BEGIN

DECLARE areaID TINYINT;
DECLARE currentProcessID INT;
DECLARE num TINYINT DEFAULT 0;

DECLARE done BOOLEAN DEFAULT FALSE;
DECLARE areas_cursor CURSOR FOR (SELECT id from areas);
DECLARE CONTINUE HANDLER FOR SQLSTATE '02000' SET done = TRUE;

SET currentProcessID = (SELECT id FROM process ORDER BY name DESC LIMIT 1);

OPEN areas_cursor;

	loop1: LOOP
    
		FETCH areas_cursor INTO areaID;

		IF done THEN LEAVE loop1;
		END IF;
		
        SET @count = (SELECT count(1) FROM courses WHERE id IN (SELECT courses_id FROM distributions WHERE areas_id = areaID AND courses_id NOT IN (SELECT courses_id FROM ranks WHERE process_id = currentProcessID AND areas_id = areaID)));
        
        SET num = num + @count;
        
        
	END LOOP loop1;

CLOSE areas_cursor;
  
SELECT num;

END ;;
DELIMITER ;
