BEGIN

	SET @idPerson = (SELECT id FROM people WHERE dni = _dni);    
    IF @idPerson IS NULL THEN
		INSERT INTO people VALUES (null, _dni, _name, _lastname, (SELECT id FROM genders WHERE gender = _gender));
    END IF;
	SET @idPerson = (SELECT id FROM people WHERE dni = _dni);

	SET @stdID = (SELECT id FROM students WHERE people_id = @idPerson);    
    IF @stdID IS NULL THEN
		INSERT INTO students VALUES (null, @idPerson);
    END IF;
	SET @stdID = (SELECT id FROM students WHERE people_id = @idPerson);
    
    SET @progID = (SELECT id FROM programs WHERE name = _program);
    SET @procID = (SELECT id FROM process ORDER BY name DESC LIMIT 1);
    
    SET @stdtID = (SELECT id FROM student_data WHERE students_id = @stdID AND programs_id = @progID AND process_id = @procID AND code = _code); 
    IF (@stdtID IS NULL) THEN
		INSERT INTO student_data VALUES (null, _code, _omg, 0, @stdID, @progID, @procID, _score, _postulantcode, _good, _bad, _blank);
    END IF;
	SET @stdtID = (SELECT id FROM student_data WHERE students_id = @stdID AND programs_id = @progID AND process_id = @procID AND code = _code);
    
    SELECT @stdtID AS id;

END ;;
